import { Col, Container, Row } from "react-bootstrap"

const arrays = [
    {
        id: 1,
        name: 'Mark'
    },
    {
        id: 2,
        name: 'Mark'
    },
    {
        id: 3,
        name: 'Mark'
    },
    {
        id: 4,
        name: 'Mark'
    },
]
const ArrayMaps = arrays.map(
    (array) => 
    
    <Row key = {array.id}>
        <Col sm = {12} md= {6}>
            <Array/>
        </Col>
    </Row>
)

function Array(){
    return(
        <Container>
            {ArrayMaps}
        </Container>
    )
}

export default Array
